import React from 'react'

export default function ActivitiesDetail({actsDetail}) {

let act = actsDetail[0];

  return (
    <div>
        <h3>{act.name}</h3>
        <h3>{act.duration}</h3>
        <h3>{act.difficulty}</h3>
        <h3>{act.season}</h3>
    </div>
  )
};
